INSERT INTO `Receta` (`id_receta`, `nombre_receta`, `consejos_receta`, `pasos_receta`, `imagen_receta`, `tiempo_preparacion_receta`, `dificultad_receta`, `id_autor`, `tipo_receta`, `tipo_coccion_receta`, `publicada_por_restaurante`, `visible_receta`) VALUES
(1, 'Arroz con Pollo', '- Si tienes el pollo congelado, puedes saltarte el primer paso y agregarlo con todas las verduras, de esta forma el pollo se descongelará e irá cogiendo más sabor. ', '1. Sofreír el pollo.\\n 2. Agregar verduras.\\n 3. Añadir arroz y cocer con caldo.', '/assets/img_recetas/ArrozconPollo.png', 45, 'Media', NULL, 'Carnívora', 'Hervido', 0, 1),
(2, 'Puré de Patata', '- Elige las patatas adecuadas, las mejores son las harinosas o secas, como la Monalisa, Kennebec o Agria. Contienen menos agua y resultan en un puré más suave.\\n\n- Cocción uniforme: Cocina las patatas con piel en agua fría con sal. Esto evita que absorban demasiada agua y que el puré quede aguado. Si las pelas, córtalas en trozos de tamaño similar para que se cocinen de manera uniforme.\\n\n- Prensado: Utiliza un pasapurés o un prensa patatas. Evita la batidora eléctrica, ya que puede romper demasiado el almidón y darle una textura gomosa al puré.\n', '1. Hervir las patatas. \\n2. Machacar y añadir leche y mantequilla.', '/assets/img_recetas/Puré de Patata.png', 30, 'Fácil', NULL, 'Vegetariana', 'Hervido', 0, 1),
(3, 'Espaguetis con Tomate y Queso', '- Si puedes, haz tu propia salsa. Sofríe ajo picado y cebolla (opcional) en aceite de oliva. Añade tomate triturado (o natural rallado), una pizca de azúcar (para contrarrestar la acidez), sal, pimienta y hierbas como orégano o albahaca. Cocina a fuego lento para que los sabores se concentren.', '1. Cocer la pasta.\\n 2. Preparar salsa con tomate y cebolla.\\n 3. Servir con queso.', '/assets/img_recetas/Espaguetis con Tomate y Queso.png', 25, 'Fácil', NULL, 'Vegetariana', 'Hervido', 0, 1),
(4, 'Tortilla de Patatas', '- Fríe las patatas en abundante aceite de oliva virgen extra a fuego medio. Queremos que se pochen (se cocinen lentamente y se ablanden) más que se doren. Escúrrelas muy bien del exceso de aceite una vez pochadas.', '1. Freír la patata y cebolla.\\n 2. Mezclar con huevo batido.\\n 3. Cuajar en sartén.', '/assets/img_recetas/Tortilla de Patatas.png', 30, 'Fácil', NULL, 'Vegetariana', 'Frito', 0, 1),
(5, 'Pan Casero', '- Es crucial para desarrollar el gluten, que le da al pan su estructura. Amasa enérgicamente durante al menos 10-15 minutos a mano, o usa una amasadora. La masa debe ser elástica y suave.', '1. Amasar harina con agua y levadura. 2. Dejar fermentar. 3. Hornear.', '/assets/img_recetas/Pan Casero.png', 120, 'Media', NULL, 'Vegetariana', 'Asado', 0, 1);
INSERT INTO `Receta` (`id_receta`, `nombre_receta`, `consejos_receta`, `pasos_receta`, `imagen_receta`, `tiempo_preparacion_receta`, `dificultad_receta`, `id_autor`, `tipo_receta`, `tipo_coccion_receta`, `publicada_por_restaurante`, `visible_receta`) VALUES
